import React from 'react';
  
const About = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Center',
        alignItems: 'Left',
        height: '100vh'
      }}
    >
      <h1>About Us</h1>
    </div>
  );
};
  
export default About;
